const Todo = () => {
  const todosList = [
    {
      id: 1,
      content: '店予約する',
    },
    {
      id: 2,
      content: '卵買う',
    },
    {
      id: 3,
      content: '郵便出す',
    },
  ];

  return (
    <>
      <h1>Reminder</h1>
      {todosList.map((todo) => {
        return { todo };
      })}
    </>
  );
};
